import React, { Component } from "react";
import { Navbar, Dropdown, Container, Figure } from "react-bootstrap";
import { FaUser } from "react-icons/fa";
import { getEvents } from "../API/eventAPI";

class HomePage extends Component {
    componentWillMount() {
        getEvents("paris").then((res) => {
            console.log(res.data.events.event);
        });
    }

    render() {
        return(
            <div>
                <Navbar bg="dark" variant="dark" className="justify-content-between" fixed>
                    <Navbar.Brand href="#home">My Event</Navbar.Brand>
                    <Dropdown alignRight>
                        <Dropdown.Toggle variant="primary">
                            <FaUser/>
                        </Dropdown.Toggle>
                        <Dropdown.Menu>
                            <Dropdown.Item>Login</Dropdown.Item>
                            <Dropdown.Item>Sign Up</Dropdown.Item>
                        </Dropdown.Menu>
                    </Dropdown>
                </Navbar>
                <Container>
                    <Figure>

                    </Figure>
                </Container>
            </div>
        );
    }
}

export default HomePage;
